import React from 'react';
import CharacterCard from './CharacterCard';

const CharacterList = (props) => {
  debugger;
  console.log(props);
  const errorRoute = (props) => {
    if (props.filteredItems.length === 0) return <p>'No hay ningún personaje que coincida con tu búsqueda'</p>;
  };

  return (
    <>
      {errorRoute}
      <ul className='list'>
        <CharacterCard filteredItems={props.filteredItems} />
      </ul>
    </>
  );
};

export default CharacterList;
